// context/WebGazerContext.js
import React, { createContext, useContext } from 'react';
import useWebGazer from '../hooks/useWebGazer';

const WebGazerContext = createContext();

export const WebGazerProvider = ({ children }) => {
  const { webgazerReady, webgazerInstance, gazeTimers } = useWebGazer((data) => {
    // Handle gaze data here
  });

  return (
    <WebGazerContext.Provider value={{ webgazerReady, webgazerInstance, gazeTimers }}>
      {children}
    </WebGazerContext.Provider>
  );
};

export const useWebGazerContext = () => useContext(WebGazerContext);
